Sounds like a chrome bug to me. We had already such a bug in the mailclient with their transparent themes. (bug #3496)

I also found out that this is a windows only problem with setting the opacity. Works fine on mac and linux.

Here is some code to reproduce:

var list = new qx.ui.form.List();
for (var i = 0; i < 12; i++) {
  list.add(new qx.ui.form.ListItem("Listitem " + i));
}

this.getRoot().add(list);
list.getContentElement().setStyle("opacity", 0.5);


But as in the other bug report, as long as you use native scrollbars, we cant do much about it.
